import re

def three_to_ten_times_abc(string):
    return bool(re.fullmatch("(abc){3,10}",string))

string="abc"
print(three_to_ten_times_abc(string))
string="abcabcabc"
print(three_to_ten_times_abc(string))
string="abcabcabcabcabcabc"
print(three_to_ten_times_abc(string))
string="abcabcabcabcabcabcabcabcabcabc"
print(three_to_ten_times_abc(string))
string=""
print(three_to_ten_times_abc(string))